INSERT INTO javaee.schedule (artist, intro, poster, schedule, time, type, venue, status) VALUES ('落日飞车', 'THE BEAUTY OF ADULTS  ︎  ︎  ︎ ︎  ︎  ︎  ︎  ︎  ︎  ︎  ︎  ︎  ︎  ︎  ︎  ︎

成人之美是一種感覺，
是賀爾蒙面俠蘇洛的劍，
挑起心中喧囂而起的慾念，
由南到北，像是風吹，或是冬眠。

成人之美是一頓午覺，
是蒙太奇異果多汁的鞘，
滑進夢裏飄逸而落的蜜桃，
由裡到外，先是狂喜，才是微笑。', 'data:image/jpeg;base64,', '落日飛車貳零壹捌成人之美巡演', '2018-04-07 20:00:00', '演唱会', 1111112, 0);
